import React from 'react'
import { Formik, Field, Form, ErrorMessage } from 'formik'
import * as yup from 'yup'
import { TextField, Button } from '@material-ui/core'

const Studentform = () => (
	<>
		<Formik
			initialValues={{
					firstName: '',
					lastName: '',
			}}
			validationSchema={validationSchema}
			onSubmit={(values, { setSubmitting }) => {
        setTimeout(() => {
          alert(JSON.stringify(values, null, 2));
          setSubmitting(false);
        }, 400);
      }}
    >
      {({ isSubmitting }) => (
        <Form>
          <TextField helperText = "Donald" required variant = "filled" type="text" name="firstName" />
          <ErrorMessage name="firstName" color = "red" component="div" />
          <TextField helperText = "Duckd" required variant = "filled" type="text" name="lastName" />
          <ErrorMessage name="lastName" component="div" />
          <div>
						<Button variant="contained" color = "Primary" type="submit" disabled={isSubmitting}>
							Submit
						</Button>
					</div>
        </Form>
      )}
    </Formik>
	</>
)

const validationSchema = yup.object(
	{
		firstName: yup
		.string()
	},
	{
		lastName: yup
		.string()
	}
)
export default Studentform
